В маркетинге с 2005 года.

Сертифицированный SMM-специалист и таргетолог ВКонтакте, Instagram, Facebook, Одноклассники.

Основные направления деятельности: 

◉ Продвижение мероприятий (Концерты/Фестивали/Вечеринки) ;
◉ Продвижение недвижимости (Агентства/Застройщики/ЖК);
◉ Продвижение заведений общественного питания (Кафе/Бары/Рестораны);
◉ Внедрение воронок продаж;
◉ Автоматизация воронок продаж;
◉ Мессенджер-маркетинг;
◉ Создание, настройка и поддержка чат-ботов.
